import React from "react";
import {IonBackButton, IonButtons, IonContent, IonHeader, IonPage, IonTitle, IonToolbar} from "@ionic/react";
import {RouteComponentProps} from "react-router";

interface SuitcaseDetailsProps extends RouteComponentProps<{
  tripName: string;
  suitcaseName: string;
}> {}


const SuitcaseDetails: React.FC<SuitcaseDetailsProps> = ({match}) => {

  let tripName: string = match.params.tripName;

  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonButtons slot="start">
            <IonBackButton defaultHref="/trips"/>
          </IonButtons>
          <IonTitle>
            Inside {name} Suitcase
          </IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent>

      </IonContent>
    </IonPage>
  );
}

export default SuitcaseDetails;
